import React from 'react';
import Profile from './components/Profile';
import user from './data/social-profile/user.json';

const App = () => {
    

<Profile
  name={user.name}
  tag={user.tag}
  location={user.location}
  avatar={user.avatar}
  stats={user.stats}
/>

}
export default App;
